    #[doc = " \t\t\t\t\tBIT_0 | BIT_4,\t// The bits within the event group to wait for."]
    #[doc = " \t\t\t\t\tpdTRUE,\t\t\t// BIT_0 and BIT_4 should be cleared before returning."]
