    #[doc = " \t\t\t// xEventGroupWaitBits() returned because just BIT_4 was set."]
    #[doc = " \t\t}"]
    #[doc = " \t\telse"]
    #[doc = " \t\t{"]
    #[doc = " \t\t\t// xEventGroupWaitBits() returned because xTicksToWait ticks passed"]
    #[doc = " \t\t\t// without either BIT_0 or BIT_4 becoming set."]
